query QueryRenderersCitySectionListQuery(
  $citySlug: String!
  $partnerType: PartnerShowPartnerType
) {
  city(slug: $citySlug) {
    ...CitySectionList_city_3XGJno
  }
}

fragment CitySectionList_city_3XGJno on City {
  name
  shows(discoverable: true, first: 20, sort: START_AT_ASC, after: "", partnerType: $partnerType) {
    pageInfo {
      endCursor
      hasNextPage
    }
    edges {
      node {
        id
        _id
        __id
        is_followed
        start_at
        end_at
        status
        href
        type
        name
        cover_image {
          url
        }
        exhibition_period
        partner {
          __typename
          ... on Partner {
            name
            type
          }
          ... on ExternalPartner {
            name
            __id
          }
          ... on Node {
            __id
          }
        }
        __typename
      }
      cursor
    }
  }
}
